import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import Header from '../Header';


function Home() {
  document.title="Home Page"
  return (
      <Container fluid className="px-0">
        <Header />
        <div id="front-image">
        </div>
      <Row className="mx-0">
        <Col md={6} sm={12}>
          <h4 id='about' className="float-right">
            Hi, I'm Anshor
            <br />
            I'm a Front-end Developer
          </h4>
        </Col>
        <Col md={6} sm={12}>

        </Col>
      </Row>
    </Container>
  );
}

export default Home;
